    showDownload() {
        setTimeout(() => {
            var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
            var graphics = this.add.graphics({
                fillStyle: {
                    color: 0x000000
                }
            });
            graphics.alpha = 0.85;
            graphics.setDepth(8);
            graphics.fillRectShape(rect);
            var winPanel = this.add.sprite(game.config.width / 2+10, game.config.height / 2 + 500, "win_bg");
            winPanel.setDepth(10);
            var tmc = this.add.image(0,0,'bg').setOrigin(0,0).setInteractive().setDepth(5)
            tmc.alpha = 0.001
            // show panel
            this.tweens.add({
                targets: [winPanel],
                y: game.config.height / 2 - 50,
                duration: 1000,
                ease: 'Back',
                callbackScope: this,
                onComplete: function (tween) {
                    //原地弹出
                    var downloadBtn = this.add.sprite(256, game.config.height / 2 + 40, 'play_now').setInteractive()
                    downloadBtn.setDepth(11);
                    downloadBtn.scaleX = 1.5
                    downloadBtn.scaleY = 1.5
                    this.tweens.add({
                        targets: [downloadBtn],
                        y: game.config.height / 2 + 40,
                        duration: 300
                    })
    
                    downloadBtn.on('pointerdown', function (pointer) {
                        landingPage();
                    }, this);
                    downloadBtn.on('touchstart', function (pointer) {
                        landingPage();
                    }, this);
    

    
    
    


                    this.tweens.add({
                        targets: [downloadBtn],
                        scaleX: 1,
                        scaleY: 1,
                        duration: 250,
                        ease: 'Back'
                    });
                }
            });
        }, 500);
    }
